        <div className="notes">
          <h3>Notes:</h3>
          <h3> 1. Show they're links </h3>
          <h3> 2. Add icons </h3>
          <h3> 3. Style unique background </h3>
        </div>


        <h2>Thank you for exploring our beautiful city!</h2>
        <h2>Hop you had fun exploring our beautiful city!</h2>

        <BottomNav />
      </section>
    );
  }
}

export default Profile;
